import React from "react";




const Inicio = ({showshow}) => {
    return(
        <div >
            <h1></h1>
            <p>TEST DE AUTOEVALUACIÓN DE SÍNTOMAS DEL COVID-19</p>
            <button className="BtnInicio" onClick={showshow}>EMPEZAR TEST</button>
        </div>

    );
};


export default Inicio;
